import React from "react";
import "./home.css";

function Nav() {
    return (
        <div className="coverContainer">
        <div className="navbar">
          <ul className="navContainer">
            <li>JC</li>
            <li><Link className="link" to="/" style={{ textDecoration: "none" }}>
          home
        </Link></li>
            <li><a href="#about-me-section">About Me</a></li>
            <li>Portfolio</li>
            <li>Resume</li>
            <button className="button-17" role="button">
              <li>CONTACT ME</li>
            </button>
          </ul>
        </div>
      </div>
    );
}


export default Nav;
